window.bookSummaryJSON = "<p>For Larison, a man off the grid and on the run, the sleepy northern California town of Arcata, gateway to the state's fabled Lost Coast, seems like a perfect place to disappear for a while. But Arcata isn't nearly as sleepy as it seems, and when three locals decide Larison would make a perfect target for their twisted sport, Larison exacts a lifetime of vengeance in one explosive evening. </p>"; 
